require.config({"config": {
        "text":{"Magento_Ui/templates/grid/controls/bookmarks/bookmarks.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"admin__action-dropdown-wrap admin__data-grid-action-bookmarks\" collapsible>\n    <button class=\"admin__action-dropdown\" type=\"button\" toggleCollapsible>\n        <span class=\"admin__action-dropdown-text\" translate=\"activeView.label\"/>\n    </button>\n    <ul class=\"admin__action-dropdown-menu\">\n        <!-- ko foreach: { data: viewsArray, as: '$view'}  -->\n            <li css=\"_edit: $parent.isEditing($view.index)\" outerClick=\"$parent.endEdit.bind($parent, $view.index)\" template=\"$parent.viewTmpl\"/>\n        <!-- /ko -->\n        <li visible=\"hasChanges\" outerClick=\"hideCustom.bind($data)\"\n            css=\"\n                _edit: customVisible,\n                'action-dropdown-menu-action action-dropdown-menu-item-last': !customVisible\">\n            <a href=\"\" visible=\"!customVisible\" click=\"showCustom\" translate=\"'Save View As...'\"/>\n            <div class=\"action-dropdown-menu-item-edit\" visible=\"customVisible\">\n                <input class=\"admin__control-text\" type=\"text\"\n                    data-bind=\"\n                        value: customLabel,\n                        autoselect,\n                        hasFocus: isCustomVisible(),\n                        keyboard: {\n                            13: applyCustom.bind($data),\n                            27: hideCustom.bind($data)\n                        }\">\n                <div class=\"action-dropdown-menu-item-actions\">\n                   <button class=\"action-submit\" type=\"button\" click=\"applyCustom\" attr=\"title: $t('Save all changes')\">\n                        <span translate=\"'Submit'\"/>\n                    </button>\n                </div>\n            </div>\n        </li>\n    </ul>\n</div>\n"}
}});
